import React from 'react';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      name: 'hi',
      fam: [
        { gName: 'ace', age: 27, },
        { gName: 'granny', age: 25,  }
      ]
    };
  }
  use = () => {
    return this.state.fam.map(name => (
      <li key={name.toString()}>{name.gName}</li>
    ));
  };
  render() {
    return (
      <div>
        hi
        {this.use()}
      </div>
    );
  }
}

export default App;
